import React from "react";
import styles from './footer.module.css';

const Footer = () => {
    return (
        <section id={styles.footerSection}>
            <h1>&copy; 2025 Michael Balogun</h1>
            <hr></hr>
            <p>Github</p>
            <p>Linked In</p>

        </section>
    )
}

export default Footer;
